marker.position.z = random(-100, 100);
marker.position.x = random(-50, 50);

camera.position.z = 2;
camera.position.x = -2;
camera.position.y = 0.5;
camera.rotation.y = -1.5;
ground.position.y = -1;
ground.position.z = 2;
cube.position.z = random(-50, 50);
cube.position.x = random(-50, 50);
cube.position.y = 0;
obstacle.position.z = -3;
obstacle.position.x = 2;

var throttle = false;
function animate() {
  requestAnimationFrame(animate);
  document.getElementById("loading").innerHTML = null;
  // Check for ground collisions
  if (cube.position.y < 0) {
    cube.position.y = 0;
  }
  // Position the camera to follow the plane
  camera.position.x = cube.position.x - 3;
  camera.position.y = cube.position.y;
  camera.position.z = cube.position.z;
  //camera.rotation.x = cube.rotation.x + 3;
  //camera.rotation.y = cube.rotation.y;
  //camera.rotation.z = cube.rotation.z + 3;

  // Position wings
  wing.position.x = cube.position.x + 1;
  wing.position.y = cube.position.y;
  wing.position.z = cube.position.z;
  wing.rotation.x = cube.rotation.x;
  wing.rotation.y = cube.rotation.y;
  wing.rotation.z = cube.rotation.z;

  window1.position.x = cube.position.x + 0; // 3
  window1.position.y = cube.position.y + 0.3; // 0.66
  window1.position.z = cube.position.z;
  window1.rotation.x = cube.rotation.x;
  window1.rotation.y = cube.rotation.y;
  window1.rotation.z = cube.rotation.z;

  //camera.rotation.y = cube.rotation.y;
  //camera.rotation.z = cube.rotation.z;
  if (throttle == true) {
    cube.translateX(0.01);
  }
  if (throttle == false && cube.position.y > 0) {
    cube.translateX(0.005);
    cube.rotation.z -= 0.001;
  }
  renderer.render(scene, camera);
}

document.onkeydown = checkKey;

function checkKey(e) {
  e = e || window.event;

  if (e.keyCode == "65") {
    // A KEY
    cube.rotation.y += 0.1;
  } else if (e.keyCode == "68") {
    // D KEY

    cube.rotation.y -= 0.1;
  } else if (e.keyCode == "87") {
    // W KEY

    cube.rotation.z -= 0.1;
  } else if (e.keyCode == "83") {
    // S KEY
    cube.rotation.z += 0.1;
  } else if (e.keyCode == "32") {
    // Space key turns on or off throttle

    if (throttle == false) {
      throttle = true;
    } else {
      throttle = false;
    }

    // cube.rotation.z += 0.1;
  } else if (e.keyCode == "37") {
    camera.rotation.y += 0.1;
  } else if (e.keyCode == "39") {
    camera.rotation.y -= 0.1;
  }
}
